import React from 'react'
import './App.css'
import Container from './components/Container'
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (


      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Container />} />
        </Routes>
      </BrowserRouter>


  );
}

export default App;
